import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input and extract user profile information
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    const searchInputValue = await page.$eval('#searchInput', el => el.placeholder);

    // Wait for the profile link and click it
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Wait for profile elements to load
    await page.waitForSelector('.profile-header', { timeout: 5000 });
    const profileData = await page.evaluate(() => {
      const username = document.querySelector('.username').innerText;
      const fullName = document.querySelector('.profile-info h2').innerText;
      const bio = document.querySelector('.bio').innerText;
      return { username, fullName, bio };
    });

    // Take screenshot of the profile
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile.png'));

    return {
      success: true,
      action: "User profile information harvested successfully",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
